import React from 'react';
import Card from '../components/Card';

const ReadPosts = ({ posts }) => {
    return (
        <div className="ReadPosts">
            {posts.map((post, index) => (
                <Card
                    key={index}
                    id={post.id}
                    name={post.name}
                    flavor={post.flavor}
                    frostingColor={post.frostingColor}
                    toppings={post.toppings}
                />
            ))}
        </div>
    )
}

export default ReadPosts;
